-- ----------------------------
--  Table structure for `hw_commission`
-- ----------------------------
DROP TABLE IF EXISTS `hw_commission`;
CREATE TABLE `hw_commission` (
  `COMMISSIONID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `PAY` bigint(20) DEFAULT NULL COMMENT '支付金额',
  `PAYTIME` datetime DEFAULT NULL COMMENT '支付时间',
  `PAYSTATUS` varchar(1) DEFAULT NULL COMMENT '支付状态',
  `AGENT_ORDER_ID` bigint(18) DEFAULT NULL,
  `SVN` varchar(30) DEFAULT NULL COMMENT '号码',
  `CREATETIME` datetime DEFAULT NULL COMMENT '建立时间',
  `COMMISSIONTYPE` char(1) DEFAULT NULL COMMENT '做扣，佣金',
  `AGENTID` bigint(20) DEFAULT NULL COMMENT '代理商ID',
  `PAYTYPE` varchar(1) DEFAULT NULL COMMENT '支付类型，做扣，返佣',
  `CHARGETYPE` varchar(16) DEFAULT NULL,
  `COMMISSIONCODE` varchar(32) DEFAULT NULL COMMENT '后台佣金编码',
  `COMMENT` varchar(256) DEFAULT NULL,
  PRIMARY KEY (`COMMISSIONID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `hw_commission_rule`
-- ----------------------------
DROP TABLE IF EXISTS `hw_commission_rule`;
CREATE TABLE `hw_commission_rule` (
  `RULEID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `BACK_EXPRESS` varchar(512) DEFAULT NULL COMMENT '返佣表达式',
  `RULE_DESC` varchar(1024) DEFAULT NULL COMMENT '佣金规则描述',
  `RULE_COND` varchar(512) DEFAULT NULL COMMENT '条件表达式',
  `VALID` varchar(1) DEFAULT NULL COMMENT '是否有效：1有效，0无效',
  `STARTTIME` datetime DEFAULT NULL COMMENT '有效起始时间',
  `ENDTIME` datetime DEFAULT NULL COMMENT '有效期结束时间',
  `CREATETIME` datetime DEFAULT NULL COMMENT '创建时间',
  `CREATOR` bigint(20) DEFAULT NULL COMMENT '创建者',
  `UPDATER` bigint(20) DEFAULT NULL COMMENT '更新人',
  `UPDATETIME` datetime DEFAULT NULL COMMENT '更新时间',
  `BACK_TYPE` varchar(255) DEFAULT NULL COMMENT '返佣方式：1立返，2日结，3月结',
  `RULE_NAME` varchar(128) DEFAULT NULL COMMENT '规则名称',
  `PAY_TYPE` varchar(2) DEFAULT NULL COMMENT '0:立付 1：日付 2：月底付 3:下月付 4：分月付  5：年底付',
  `mod_id` bigint(10) DEFAULT NULL,
  PRIMARY KEY (`RULEID`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

