-- ----------------------------
--  Table structure for `hw_order_info`
-- ----------------------------
DROP TABLE IF EXISTS `hw_order_info`;
CREATE TABLE `hw_order_info` (
  `ORDER_ID` bigint(16) NOT NULL AUTO_INCREMENT,
  `COUNTS` bigint(8) DEFAULT NULL COMMENT '商品数量',
  `COMMENTS` varchar(255) DEFAULT NULL COMMENT '订单备注',
  `STATUS` varchar(4) DEFAULT NULL COMMENT '订单状态0:待支付,1:待确认,2:处理中，3:已出库，4:交易成功，5:已作废',
  `ORDER_TYPE` varchar(4) DEFAULT NULL COMMENT '订单类型:\r\n01：手机 \r\n02：卡',
  `FEE` bigint(32) DEFAULT NULL COMMENT '费用  单位厘',
  `NETID` bigint(8) DEFAULT NULL COMMENT '网点id',
  `OPERATOR_ID` bigint(8) DEFAULT NULL COMMENT '操作员ID',
  `REGION_ID` bigint(8) DEFAULT NULL COMMENT '区域ID',
  `COUNTY_ID` bigint(8) DEFAULT NULL COMMENT '县分ID',
  `CREATETIME` datetime DEFAULT NULL COMMENT '创建时间',
  `SENDTIME` datetime DEFAULT NULL COMMENT '发货时间',
  `CONFIRMTIME` datetime DEFAULT NULL COMMENT '确认完成时间',
  `STATUSTIME` datetime DEFAULT NULL COMMENT '状态变更时间',
  `PAYTIME` datetime DEFAULT NULL COMMENT '支付时间',
  `SERIAL_NUMBER` varchar(128) DEFAULT NULL COMMENT '订单流水号',
  `BLANK_SERIAL_NUMBER` varchar(128) DEFAULT NULL COMMENT '银行流水号',
  `EXPRESS_CHARGE` bigint(8) DEFAULT NULL COMMENT '运费',
  `EXPRESS_NUMBER` varchar(128) DEFAULT NULL COMMENT '运输单号',
  `EXPRESS_COMPANY_NO` varchar(64) DEFAULT NULL COMMENT '物流公司编号',
  `GOOD_ID` bigint(20) DEFAULT NULL COMMENT '目前订单和商品是一对一的，商品ID',
  `REALFEE` bigint(20) DEFAULT NULL COMMENT '实际支付费用',
  `PAYMODE` varchar(16) DEFAULT NULL COMMENT '支付方式',
  `CREATOR` bigint(8) DEFAULT NULL COMMENT '代理商',
  `BSS_ORDER_SN` varchar(35) DEFAULT NULL COMMENT 'BSS流水号',
  `PLACE_TIBCO` varchar(1) DEFAULT NULL COMMENT '向TIBCO发起订单  0：否，1：是',
  PRIMARY KEY (`ORDER_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=499 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

