-- ----------------------------
--  Table structure for `hw_order_shipment`
-- ----------------------------
DROP TABLE IF EXISTS `hw_order_shipment`;
CREATE TABLE `hw_order_shipment` (
  `order_ship_id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `order_id` bigint(16) DEFAULT NULL COMMENT '订单ID',
  `order_code` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '订单号',
  `express_number` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '快递运单号',
  `express_company_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '快递公司编号',
  `express_company_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '快递公司名称',
  `ship_type` int(2) DEFAULT NULL COMMENT '发货方式 1-快递 2-其它',
  `sender` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '发件人',
  `sender_company_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '发件单位名称',
  `sender_address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '发件地址',
  `sender_tel` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '发件联系电话',
  `sender_comment` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '发件备注',
  `recipient` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '收件人',
  `recipient_company_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '收件人单位名称',
  `recipient_address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '收件地址',
  `recipient_tel` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '收件联系电话',
  `rejector` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '退货人',
  `reject_comment` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '退货备注',
  `ship_status` int(2) DEFAULT NULL COMMENT '运单状态',
  `creator` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`order_ship_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT COMMENT='订单运单表';

-- ----------------------------
--  Table structure for `hw_plan`
-- ----------------------------
DROP TABLE IF EXISTS `hw_plan`;
CREATE TABLE `hw_plan` (
  `CONTRACTID` varchar(65) COLLATE utf8_bin NOT NULL COMMENT '10010网站的合约id',
  `NAME` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '合约名称',
  `CONTRACT_FEE` bigint(20) DEFAULT NULL COMMENT '合约费用',
  `DOMESTIC_CALL` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '国内通话时长',
  `SMS` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '短信',
  `MMS` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '彩信',
  `CALLRATE` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '国内语音资费',
  `FLOWRATE` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '流量资费',
  `PRESENT` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '赠送增值业务',
  `OTHERSERVICE` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '其他服务',
  `CONTRACTTYPE` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '合约类型',
  `ANSWERFREE` varchar(16) COLLATE utf8_bin DEFAULT NULL COMMENT '免接听',
  `FLOW` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '流量',
  `LOWCOST` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '最低消费',
  `VIDEOFEE` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '视频电话费用',
  `VIDEOMIN` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '视频通话时间',
  `CID` bigint(20) NOT NULL COMMENT '主键',
  `OTHERFEE` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '其它费用',
  `UPDATETIME` datetime DEFAULT NULL COMMENT '更新时间',
  `STATUS` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '0:失效 1：生效',
  PRIMARY KEY (`CID`),
  UNIQUE KEY `UNIQUE_CONTRACTID` (`CONTRACTID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `hw_product`
-- ----------------------------
DROP TABLE IF EXISTS `hw_product`;
CREATE TABLE `hw_product` (
  `RANGEID` bigint(65) NOT NULL AUTO_INCREMENT,
  `BSS_ACCEPT_RANGE_ID` varchar(65) COLLATE utf8_bin DEFAULT NULL,
  `SVCLEVEL` varchar(16) COLLATE utf8_bin DEFAULT NULL COMMENT '销售包等级',
  `CONSUMPTION` bigint(65) DEFAULT NULL COMMENT '保底消费',
  `PRESTORE` bigint(65) DEFAULT NULL COMMENT '初始预存',
  `PACKEDPHONE` bigint(65) DEFAULT NULL COMMENT '终端',
  `PREFERENCE` varchar(16) COLLATE utf8_bin DEFAULT NULL COMMENT '偏好',
  `TERMS` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '合约期数',
  `SERVICETYPE` varchar(8) COLLATE utf8_bin DEFAULT NULL COMMENT '业务类型',
  `PACKEDNAME` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '销售包名称',
  `CONTRACTID` bigint(65) DEFAULT NULL COMMENT '合约信息id',
  `ACTIVITYID` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '网站活动ID',
  `ACTTYPE` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `ACTTYPEDES` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `MOBILEID` bigint(20) DEFAULT NULL,
  `PERIOD` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `MACHINETYPEID` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `PRICE` bigint(20) DEFAULT NULL,
  `THAWMON` bigint(20) DEFAULT NULL,
  `RESOURCESFEE` bigint(20) DEFAULT NULL,
  `PRESENETEDFEE` bigint(20) DEFAULT NULL,
  `ALLFEE` bigint(20) DEFAULT NULL COMMENT '所有返还的费用',
  `STOREDFEE` bigint(20) DEFAULT NULL,
  `STOREDDESC` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '预存描述',
  `RECOMMEND` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否推荐',
  `PRODUCT_DESC` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `PAYTYPE` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '''0 预付费，1,带终端后付费 ，2，后付费 sim，3 data-sim 都是不带终端的 9是bolt-on套餐'',',
  `VALIDTIME` datetime DEFAULT NULL,
  `INVALIDTIME` datetime DEFAULT NULL,
  `BSS_CONTRACTID` varchar(35) COLLATE utf8_bin DEFAULT NULL COMMENT 'BSS侧对应的套餐ID',
  `STATUS` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '0:失效 1：生效',
  `BSS_MOBILEID` varchar(35) COLLATE utf8_bin DEFAULT NULL COMMENT 'BSS的mobileId',
  `PIC` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '合约PIC',
  `PRODUCT_SPEC_LIST` blob COMMENT 'productOffer 对应的productSpec的json',
  `PLAN_SPEC_LIST` blob COMMENT 'planOffer对应的planSpec的json字段',
  `RESOURCE_LIST` blob COMMENT 'Offer对应的资源json',
  `PLAN_CODES` blob COMMENT 'productOffer对应的planOffer',
  `P_TYPE` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `P_SUBTYPE` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `STARTDATE` datetime DEFAULT NULL,
  `ENDDATE` datetime DEFAULT NULL,
  `ISBUNDLE` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `IS_DYN_PRICE` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `IS_DYN_ELI` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `IS_AUTO_RENEWABLE` varchar(16) COLLATE utf8_bin DEFAULT NULL,
  `GGH` blob,
  PRIMARY KEY (`RANGEID`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT;

